import React from 'react';
import Leftnav from '../Componants/leftnav';

import { useSelector, useDispatch } from 'react-redux'
import { userlist} from '../features/counter/counterSlice'

function Userlist() {
    const jadhavtext = useSelector((state) => state.counter.value);
    const dispatch = useDispatch()
    return (
      <div>
        <Leftnav/>
         {/*  User info = {jadhavtext?.userinfo.email} */}
         {
            console.log('User info list',jadhavtext?.userinfo)
         }
              <button onClick={() => dispatch(userlist())} > Get List </button> 
      </div>
    );
  }

  export default Userlist;
